    return <div>
        <b>{props.name}:</b><br/>
        <ul className={display}>
            {props.IPv4.map((data, idx)=>{
                return <li key={idx}>IPv4: {data.IP} @ {data.MAC}</li>
            })}
            {props.IPv6.map((data, idx)=>{
                return <li key={idx}>IPv6: {data.IP} @ {data.MAC}</li>
            })}
            <li>Up: {props.usage.TX} | Down: {props.usage.RX}</li>
        </ul>
    </div>
}
export default NetworkReport;
